package com.coco.io._io.iostream.outputstream;

import java.io.*;

//字节方式输出数据到磁盘文件 C:\Users\Administrator\Desktop\javaiotest\readme_output.txt ASCII
public class _OutputStream {
    private static final String PATH = "C:\\Users\\Administrator\\Desktop\\javaiotest\\readme_output.txt";

    public static void main(String[] args) throws IOException {
        writeByte();
        writeByteArray();
    }

    private static void writeByteArray() throws IOException {
        long start = start();

        OutputStream os = new FileOutputStream(new File(PATH));
        String text = "";
        System.out.println("字符串长度：" + text.length());
        byte[] bytes = text.getBytes();
        os.write(bytes);
        os.close();

        long end = end();
        used_time(end, start);
    }

    private static void writeByte() throws IOException {
        long start = start();

        OutputStream os = new FileOutputStream(new File(PATH));
        String text = "";
        System.out.println("字符串长度：" + text.length());
        byte[] bytes = text.getBytes();
        for (byte b : bytes){
            os.write(b);
        }
        os.close();

        long end = end();
        used_time(end, start);
    }

    //*********************************

    private static long start(){
        return System.currentTimeMillis();
    }

    private static long end(){
        return System.currentTimeMillis();
    }

    private static void used_time(long end, long start){
        System.out.println("===================== 用时：" + (end - start) / 1000 + " 秒，" + (end - start) + " 毫秒，=====================");
    }
}
